@JenniferJJacobs @DanDePetris @PressSec45 Ukraine had their opportunity for peace. But they refused.

Now - Russia is not interested in "peace talks". They'll continue this conflict until their goals are met. Russia holds all the leverage. And who suffers? The people of Ukraine.
https://t.co/xIUQz0JwBz

@Karmabash There is more to these proposals than what you are reading. If Ukraine really was winning, these proposals would not be on the table, or even implied.
What this amounts to is an admission that Russia has already won.
This has been in the works for 5 weeks now.
